import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Stats from "./stats"
import Stream from "./stream"

class Home extends Component {
  render() {
    return (
      <div>
        <Link to={Stream} className="btn btn-primary">hello</Link>
        <Link to={Stats} className="btn btn-primary">hello</Link>
      </div>
    );
  }
}

export default Home;
